export const fetchData = async (field = 0) => {
  if(field === 10) {
    try {
      const response = await fetch("https://jsonplaceholder.typicode.com/posts/"+field);
      const data = await response.json();
      return data;
    } catch (e) {
      console.log(e);
    }
  } else {
    try {
      const response = await fetch("https://jsonplaceholder.typicode.com/posts");
      const data = await response.json();
      return data;
    } catch (e) {
      console.log(e);
    }
  }
};
